import React from 'react';
import Schedule from './Schedule';

const LectureRoom = (props) => {

    return (
        <div> 
            <ul>

                {props.lectureRoom.map(room=><li>room.name</li>)}
            </ul>
            <ul>
                {props.lectureRoom.lecture_schedules.map(schedule=>
                    <Schedule key={schedule.id}  />
                    )}
            </ul>
        </div>
     );
}

export default LectureRoom;
